    function objLoadSync() {
      let primitive = {};
      primitive.file = "cow";
      primitive.type = "trimesh";
      primitive.buffer = {};
      primitive.uniform = {
        materialBuffer: sys.mtlGetDef(),
        cameraBuffer: () => {
          return [
            [...sys.loc.array(), 1],
            [...sys.dir.array(), 1],
            [...sys.right.array(), 1],
            [...sys.up.array(), 1],
            [sys.localTime, sys.globalDeltaTime, 1, 1],
          ];
        },
      };
      let text = cow.split("\n");
      let nv = 0,
        nf = 0;
      let I = [],
        V = [];
      for (let i = 0; i < text.length; i++) {
        let massiv = text[i].split(" ");
        if (massiv[0] === "v") {
          for (let j = 1; j < massiv.length; j++) {
            let number = parseFloat(massiv[j]);
            V.push(number);
          }
          nv++;
        } else if (massiv[0] === "f") {
          let n = 0,
            c0 = 0,
            c = 0,
            c1 = 0;
          for (let j = 1; j < massiv.length; j++) {
            c = massiv[j].split("//")[0];
            if (c < 0) {
              c = nv + c;
            } else {
              c--;
            }
            if (n == 0) {
              c0 = c;
            } else if (n == 1) {
              c1 = c;
            } else {
              I[nf++] = c0;
              I[nf++] = c1;
              I[nf++] = c;
              c1 = c;
            }
            n++;
          }
        }
      }
      //primitive.type = "tristrip";
      primitive.buffer.in_pos = V;
      primitive.buffer.index = I;
      primitive.buffer.in_normal = sys.autoNormals(V, I, "trimesh");
      new sys.createprimitive(primitive);
      return primitive;
    }

    function timer() {
      const getTime = () => {
        const date = new Date();
        let t =
          date.getMilliseconds() / 1000.0 +
          date.getSeconds() +
          date.getMinutes() * 60;
        return t;
      };

      // Timer response method
      this.responsetimer = function(tag_id = null)  {
        let t = getTime();
        // Global time
        this.globalTime = t;
        this.globalDeltaTime = t - this.oldTime;
        // Time with pause
        if (this.isPause) {
          this.localDeltaTime = 0;
          this.pauseTime += t - this.oldTime;
        } else {
          this.localDeltaTime = this.globalDeltaTime;
          this.localTime = t - this.pauseTime - this.startTime;
        }
        // FPS
        this.frameCounter++;
        if (t - this.oldTimeFPS > 3) {
          this.FPS = this.frameCounter / (t - this.oldTimeFPS);
          this.oldTimeFPS = t;
          this.frameCounter = 0;
          if (tag_id != null)
            document.getElementById(tag_id).innerHTML = this.getFPS();
        }
        this.oldTime = t;
      };

      // Obtain FPS as string method
      this.getFPS = function() {this.FPS.toFixed(3);};

      // Fill timer global data
      this.globalTime = this.localTime = getTime();
      this.globalDeltaTime = this.localDeltaTime = 0;

      // Fill timer semi global data
      this.startTime = this.oldTime = this.oldTimeFPS = this.globalTime;
      this.frameCounter = 0;
      this.isPause = false;
      this.FPS = 30.0;
      this.pauseTime = 0;

      return this;
    }

